window.onload = () => {
  $('.wp-inner').fullpage({
    beforeChange: (e) => {
      console.log(e);
      if (e.next === 1) {
        $.fn.fullpage.stop();
        $.fn.fullpage.unholdTouch();
      }
    }
  });

  const tableELE = document.getElementById('guest-list');
  const inputELE = document.getElementById('search-input');
  const searchBTN = document.getElementById('search-button');
  const tableBTN = document.getElementById('table-button');
  let searchValue = '';

  // 添加列表
  const list2html = (list) => {
    let html = '';
    list.map(({name, table}) => {
      html += `<li class="guest-line"><span class="line-name">${name}</span><span class="line-table-num">${table}</span></li>`;
    })
    if(html.trim() === '') {
      html = `<li class="guest-line"><span class="line-name">无</span></li>`;
    }
    tableELE.innerHTML = html;
  }
  list2html(guestList);

  // 搜索内容保存
  const onChange = (e) => {
    searchValue = e.target.value.trim();
    if(searchValue === '') {
      list2html(guestList);
    }
  }
  inputELE.addEventListener('input', onChange, false);

  const onSearch = () => {
    if(!searchValue) {
      list2html(guestList);
      return;
    }
    const newList = guestList.filter((item) => {
      return new RegExp(searchValue).test(item.name);
    });
    list2html(newList);
  }
  searchBTN.addEventListener('click', onSearch, false);

  const onWatch = () => {
    location.href = './table.html';
  }
  tableBTN.addEventListener('click', onWatch, false);
}